import styled from "styled-components";
import { useEffect } from "react";

const Gallery = () => {
  useEffect(() => {
    fetch("http://d7jf0xz6rqdl6.cloudfront.net", {
      mode: "no-cors",
    })
      .then((response) => console.log(response))
      .catch((e) => console.log(e));
  }, []);
  return (
    <div>
      <p>Gallery</p>
    </div>
  );
};
export default Gallery;
